import React from 'react';

const Navbar = ({ links }) => {
  return (
    <nav>
      <ul>
        {links && links.length > 0 ? (
          links.map((link, index) => (
            <li key={index}>
              <a href={link.url}>{link.label}</a>
            </li>
          ))
        ) : (
          <li>No links available</li>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
